import React from "react";
import Header from "../components/header";
import image from "../images/reception.png";

const MilesAndSmilesPage = () => {
  return (
    <div>
      <Header />
      <img
        src={image}
        alt="Miles&Smiles"
        className="h-[60px] w-[100px] object-cover"
      />
    </div>
  );
};

export default MilesAndSmilesPage;
